def leader(a)
  return a[0] if a.length == 1
  return -1 if a.uniq.length == a.length
  return a[0] if a.uniq.length == 1

  half = a.length / 2
  big = nil

  a.group_by { |n| n }.each_value do |v|
    big = v.first if v.length > half
  end

  big
end

def solution(a)
  return 0 if a.uniq.length == a.length

  count = 0
  last_leader2 = 0

  (0..a.length - 2).each do |n|
    leader1 = leader(a[0..n])
    if leader1 != -1
      if last_leader2 == 0 || a[n] == last_leader2
        leader2 = leader(a[n + 1..-1])
      else
        leader2 = last_leader2
      end

      if leader1 == leader2
        count = count + 1
        last_leader2 = leader2
      end
    else
      last_leader2 = leader(a[n + 1..-1])
    end
  end

  count
end

